import React from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import {
  HomeOutlined,
  CheckSquareOutlined,
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import { Link, Route, Routes } from 'react-router-dom';
import Home from './Home';
import Memberslist from './Memberslist';
import styled from '@emotion/styled';

const { Header, Content, Footer, Sider } = Layout;

const Tasks = () => <div>Tasks Content</div>;
const Teams = () => <div>Teams Content</div>;
const Members = () => <Memberslist />;

const StyledMenu = styled(Menu)`
  background-color: #001529;
  font-size: 18px;
`;

const StyledMenuItem = styled(Menu.Item)`
  display: flex !important;
  justify-content: center;
  align-items: center;
`;

const StyledFooter = styled(Footer)`
  text-align: center;
  font-size: 18px;
`;

class Dashboard extends React.Component {
  state = {
    collapsed: false,
  };

  onCollapse = (collapsed) => {
    this.setState({ collapsed });
  };

  render() {
    const { collapsed } = this.state;
    return (
      <Layout style={{ minHeight: '100vh' }}>
        <Sider collapsible collapsed={collapsed} onCollapse={this.onCollapse}>
          <div className="logo" />
          <StyledMenu theme="dark" defaultSelectedKeys={['1']} mode="inline">
            <StyledMenuItem key="1" icon={<HomeOutlined />}>
              <Link to="/">Home</Link>
            </StyledMenuItem>
            <StyledMenuItem key="2" icon={<CheckSquareOutlined />}>
              <Link to="/tasks">Tasks</Link>
            </StyledMenuItem>
            <StyledMenuItem key="3" icon={<TeamOutlined />}>
              <Link to="/teams">Teams</Link>
            </StyledMenuItem>
            <StyledMenuItem key="4" icon={<UserOutlined />}>
              <Link to="/members">Members</Link>
            </StyledMenuItem>
          </StyledMenu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }} />
          <Content style={{ margin: '0 16px' }}>
            <Breadcrumb style={{ margin: '16px 0' }}>
              <Breadcrumb.Item>Home</Breadcrumb.Item>
              <Breadcrumb.Item>Dashboard</Breadcrumb.Item>
            </Breadcrumb>
            <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/tasks" element={<Tasks />} />
                <Route path="/teams" element={<Teams />} />
                <Route path="/members" element={<Members />} />
              </Routes>
            </div>
          </Content>
          <StyledFooter>
            Craft Club Dashboard Â©2024 Created by <a href="https://your-link-here.com" target="_blank" rel="noopener noreferrer">Ali</a>
          </StyledFooter>
        </Layout>
      </Layout>
    );
  }
}

export default Dashboard;
